const Bio = () => {
  return (
    <div className='container' style={{ marginTop: '25px' }}>
      <h1>About Me</h1>
      <p>I am a full stack web developer &#40;MERN&#41; located in San Diego, California. Most of my time is spent researching industry standard web development tools and programming concepts. My main area of interest lies in modern front end frameworks &#40;React JS&#41;</p>
    </div>
  )
}

export default Bio
